        public static List<int> MergeSort(List<int> m)
        {
            if (m.Count <= 1)
            {
                return m;
            }

            var left = new List<int>();
            var right = new List<int>();

            for (int i = 0; i < m.Count; i++)
            {
                var current = m[i];

                if (i % 2 != 0)
                {
                    left.Add(current);
                }
                else
                {
                    right.Add(current);
                }
            }

            var leftNumsSortTask = Task.Run(() =>
            {
                left = MergeSort(left);
            });


            var rightNumsSortTask = Task.Run(() =>
            {
                right = MergeSort(right);
            });

            Task.WaitAll(leftNumsSortTask, rightNumsSortTask);

            return Merge(left, right);
        }

        private static List<int> Merge(List<int> left, List<int> right)
        {
            var result = new List<int>();

            while (left.Count > 0 && right.Count > 0)
            {
                if (left[0] <= right[0])
                {
                    result.Add(left[0]);
                    left = left.Skip(1).ToList();
                }
                else
                {
                    result.Add(right[0]);
                    right = right.Skip(1).ToList();
                }
            }

            while (left.Count > 0)
            {
                result.Add(left[0]);
                left = left.Skip(1).ToList();
            }
            while (right.Count > 0)
            {
                result.Add(right[0]);
                right = right.Skip(1).ToList();
            }

            return result;
        }
    }
